      animation: rotate 300s linear infinite;

   svg g[inkscape\:label=ninjaStar] {
      transform-origin: center;
      animation: rotate 1800s linear infinite reverse;
   }
   svg g[inkscape\:label=ninjaStar] circle {
      display: none;
   }
   svg g[inkscape\:label=starInner] {
      transform-origin: center;
      animation: rotate 30s linear infinite reverse;
   }
   svg g[inkscape\:label=starInner] path {
      transform-origin: center;
      animation: scaleAndOpacity 10050ms ease-in-out infinite;
   }
   svg g[inkscape\:label=ajna] {
      transform-origin: center;
      animation: rotate 30s linear infinite reverse;
   }
   svg g[inkscape\:label=ajnaGlow] {
      animation: opacity 30s ease-in-out infinite;
   }
   @keyframes rotate {
      from {
         transform: rotate(0deg);
      }
      to {
         transform: rotate(360deg);
      }
   }
   @keyframes scaleAndOpacity {
      0% {
         transform: scale(0);
         opacity: 1;
         stroke-width: 0.1;
      }
      50% {
         transform: scale(1.2);
         opacity: 0.5;
         stroke-width: 0.03;
      }
      100% {
         transform: scale(0);
         opacity: 1;
         stroke-width: 0.1;
      }
   }
   @keyframes opacity {
      0% {
         opacity: 0.9;
      }
      50% {

      }
      100% {
         opacity: 0.9;
      }
   }
